', 'Setelah dilakukan tindakan keperawatan selama 7x24 jam diharapakan ventilasi spontan meningkat dengan kriteria hasil: penggunaan otot bantu nafas menurun, gelisah menurun, dispneu menurun, takikardi membaik, PO2 membaik; Setelah dilakukan perawatan 7x24 jam diharapkan status menyusui membaik dengan kriteria hasil : Perlekatan bayi pada payudara ibu meningkat, Kemampuan ibu memposisikan bayi meningkat, Hisapan bayi meningkat, Bayi rewel menurun. Setelah dilakukan perawatan 7x24 jam, diharapkan curah jantung meningkat dengan Kriteria Hasil : kekuatan nadi perifer meningkat, bradikardi menurun, edema menurun, dispnoe menurun, pucat/sianosis menurun, murmur jantung menurun.', '', '', '', '', '', '', '', '', '1692', '1', '<p><b>Intervensi Keperawatan:</b> Monitor adanya kelelahan otot bantu nafas, Monitor status respirasi dan oksigenisasi, Pertahankan kepatenan jalan nafas, Bantu untuk merubah posisi jika diperlukan, Lakukan auskultasi bunyi pernafasan secara teratur, Identifikasi keadaan emosional ibu saat akan dilakukan konseling menyusui, Identifikasi keinginan dan tujuan menyusui, Identifikasi permasalahan yang ibu alami selama proses menyusui, Berikan informasi dan saran menyusui yang benar sesuai kebutuhan ibu, Identifikasi tanda dan gejala primer penurunan curah jantung (meliputi dispnoe, kelelahan, edema, orthopnoe, paroxysmal nocturnal dyspnoe, peningkatan CVP), Monitor intake dan output cairan, Monitor saturasi oksigen, Posisikan pasien semi-fowler atau fowler dengan kaki ke bawah atau posisi nyaman, Kolaborasi pemberian oksigen untuk mempertahankan saturasi oksigen >94 %.</p><p><div><b>Kolaborasi:</b> post tranfusi FFP 2 kali selesai terakhir 13/03/25 jam 00.30, weaning setting venti bertahap, minum 17 - 25 cc/3jam (20 cc), post tranfusi PRC 2x12 cc selesai tanggal 18/3/25 jam 17.10 WIB, terapi Paracetamol drip 12,2 mg/6jam (diberikan sampai dengan pasien dipulangkan), rencana evaluasi echokardiografi 1 bulan kemudian, <b>Th/paracetamol injeksi ganti dengan Paracetamol drop 3x0,2ml.</b></div></p>', NULL, '1692', 0, NULL, '2025-03-24 07:56:55')
